import React from 'react';
import Header from './Header';
import Main from './Main';
import Background from './background.jpg';

const style = {
  width: "100%",
  height: "400px",
  backgroundImage: "url(" + {Background} + ")"
};

class App extends React.Component {

  render() {
    return (
      <div style={style}>
        <Header/>
        <Main />
      </div>
    );
  }

}

export default App;
